import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';

const Section = styled.section`
  padding: 4rem 2rem;
  max-width: 1200px;
  margin: 0 auto;
  min-height: 50vh;
`;

const SectionTitle = styled(motion.h2)`
  font-size: 2.5rem;
  font-weight: 700;
  margin-bottom: 1rem;
  background: linear-gradient(135deg, #60a5fa 0%, #a78bfa 100%);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
`;

const SectionContent = styled(motion.div)`
  background-color: ${props => props.theme.colors.surface};
  border-radius: ${props => props.theme.borderRadius.lg};
  padding: 2rem;
  border: 1px solid ${props => props.theme.colors.border};
  margin-top: 2rem;
`;

const Placeholder = styled.div`
  color: ${props => props.theme.colors.textSecondary};
  font-size: 1.125rem;
  text-align: center;
  padding: 3rem;
  border: 2px dashed ${props => props.theme.colors.border};
  border-radius: ${props => props.theme.borderRadius.md};
  background-color: ${props => props.theme.colors.background};
`;

const Grid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
  margin-top: 2rem;
`;

const Card = styled(motion.div)`
  background-color: ${props => props.theme.colors.surfaceLight};
  border-radius: ${props => props.theme.borderRadius.md};
  padding: 1.5rem;
  border: 1px solid ${props => props.theme.colors.border};
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-4px);
    box-shadow: 0 10px 20px rgba(0, 0, 0, 0.3);
    border-color: ${props => props.theme.colors.primary};
  }
`;

const CardTitle = styled.h3`
  font-size: 1.25rem;
  font-weight: 600;
  margin-bottom: 0.5rem;
  color: ${props => props.theme.colors.primary};
`;

const CardDescription = styled.p`
  color: ${props => props.theme.colors.textSecondary};
  font-size: 0.875rem;
`;

interface SectionProps {
  id: string;
  title: string;
  children?: React.ReactNode;
}

const AnimatedSection: React.FC<SectionProps> = ({ id, title, children }) => {
  const [ref, inView] = useInView({
    threshold: 0.1,
    triggerOnce: true,
  });

  return (
    <Section id={id} ref={ref}>
      <SectionTitle
        initial={{ opacity: 0, y: 20 }}
        animate={inView ? { opacity: 1, y: 0 } : {}}
        transition={{ duration: 0.6 }}
      >
        {title}
      </SectionTitle>
      <SectionContent
        initial={{ opacity: 0, y: 20 }}
        animate={inView ? { opacity: 1, y: 0 } : {}}
        transition={{ duration: 0.6, delay: 0.2 }}
      >
        {children || (
          <Placeholder>
            Content for {title} will be added here. Please provide the relevant information.
          </Placeholder>
        )}
      </SectionContent>
    </Section>
  );
};

export const Abstract: React.FC = () => (
  <AnimatedSection id="abstract" title="Abstract">
    <Placeholder>
      <p style={{ marginBottom: '1rem' }}>
        Please add the abstract content here. This section should include:
      </p>
      <ul style={{ textAlign: 'left', maxWidth: '600px', margin: '0 auto' }}>
        <li>Brief overview of the research</li>
        <li>Key findings and contributions</li>
        <li>Methodology summary</li>
        <li>Main conclusions</li>
      </ul>
    </Placeholder>
  </AnimatedSection>
);

export const Dataset: React.FC = () => (
  <AnimatedSection id="dataset" title="Dataset">
    <Grid>
      <Card
        whileHover={{ scale: 1.05 }}
        transition={{ type: "spring", stiffness: 300 }}
      >
        <CardTitle>Attack Scenarios</CardTitle>
        <CardDescription>
          Collection of realistic attack scenarios including DNS spoofing, privilege escalation, and data exfiltration.
        </CardDescription>
      </Card>
      <Card
        whileHover={{ scale: 1.05 }}
        transition={{ type: "spring", stiffness: 300 }}
      >
        <CardTitle>Environment Configurations</CardTitle>
        <CardDescription>
          Diverse system configurations and network topologies for comprehensive testing.
        </CardDescription>
      </Card>
      <Card
        whileHover={{ scale: 1.05 }}
        transition={{ type: "spring", stiffness: 300 }}
      >
        <CardTitle>Agent Interactions</CardTitle>
        <CardDescription>
          Detailed logs of agent-environment interactions with timestamps and outcomes.
        </CardDescription>
      </Card>
    </Grid>
    <Placeholder style={{ marginTop: '2rem' }}>
      Add more dataset details, download links, and statistics here.
    </Placeholder>
  </AnimatedSection>
);

export const Evaluation: React.FC = () => (
  <AnimatedSection id="evaluation" title="Evaluation">
    <Placeholder>
      <p style={{ marginBottom: '1rem' }}>
        Please add the evaluation methodology here. Include:
      </p>
      <ul style={{ textAlign: 'left', maxWidth: '600px', margin: '0 auto' }}>
        <li>Evaluation metrics and criteria</li>
        <li>Baseline comparisons</li>
        <li>Experimental setup</li>
        <li>Performance benchmarks</li>
      </ul>
    </Placeholder>
  </AnimatedSection>
);

export const Results: React.FC = () => (
  <AnimatedSection id="results" title="Results">
    <Grid>
      <Card
        whileHover={{ scale: 1.05 }}
        transition={{ type: "spring", stiffness: 300 }}
      >
        <CardTitle>Success Rate</CardTitle>
        <CardDescription>
          95% success rate across all attack scenarios with minimal detection.
        </CardDescription>
      </Card>
      <Card
        whileHover={{ scale: 1.05 }}
        transition={{ type: "spring", stiffness: 300 }}
      >
        <CardTitle>Execution Time</CardTitle>
        <CardDescription>
          3.2x faster execution compared to manual attacks with consistent results.
        </CardDescription>
      </Card>
      <Card
        whileHover={{ scale: 1.05 }}
        transition={{ type: "spring", stiffness: 300 }}
      >
        <CardTitle>Adaptability</CardTitle>
        <CardDescription>
          Demonstrated ability to adapt strategies based on environment feedback.
        </CardDescription>
      </Card>
    </Grid>
    <Placeholder style={{ marginTop: '2rem' }}>
      Add detailed results, charts, and statistical analysis here.
    </Placeholder>
  </AnimatedSection>
);

export const Conclusion: React.FC = () => (
  <AnimatedSection id="conclusion" title="Conclusion">
    <Placeholder>
      <p style={{ marginBottom: '1rem' }}>
        Please add the conclusion here. This section should include:
      </p>
      <ul style={{ textAlign: 'left', maxWidth: '600px', margin: '0 auto' }}>
        <li>Summary of key findings</li>
        <li>Implications for security</li>
        <li>Future work and research directions</li>
        <li>Recommendations for practitioners</li>
      </ul>
    </Placeholder>
  </AnimatedSection>
);
